                    'modtpl' => 'shopping-cart',
                    ));
            }
            else{
                $_message = $this->l($GLOBALS["cYPhqXNmHoGKElqPPajb"], array(
                    'mod' => 'loyalty',
                    'modtpl' => 'shopping-cart',
                    ));

